ek into September? The last few weeks of summer are upon us and I can definitely tell with the cooler mornings we've been waking up to lately. I'm a little overwhelmed thinking about all that this month and onwards holds for us. We'll be starting homeschooling soon and even have a new student that will be joining us for the year. The kids are so excited about that and everyone else is telling me I'm way in over my head, as usual ü§£ 

However I love challenges and I love being busy so I'm looking forward to getting back into a routine with the kids and working on launching @deviwellnesscompany for late October. There are so many things that need to be finalized like packaging, printing of labels and completing the website. However these things are the fun parts I'm hoping because I've gotten the tedious parts done and out of the way. Who knew selling soaps would mean I would need to register every ingredient with Health Canada and get approval? Definitely not me! 

With homeschooling starting up again in our household I'm definitely going to need to start meal planning again. Currently I stay up until 2AM sometimes cooking or at least food prepping for the following day. There's got to be a better way and I just need to figure it out, hopefully soon. 
For now, I'm planning to use the weekend to meal prep since this term the kids will not be returning to their usual extra-curricular activities because of Covid. Having an infant, a child with asthma, and me with an autoimmune disorder, means I can't risk one of the kids contracting Covid. It makes me anxious just thinking about a potential second wave and the impact it could have on us. 

Are you guys sending your kids back to school? Are you considering remote learning or homeschooling? There is no right or wrong answer here as every family will do what's best for them. 

